implementation.script:
if(tw.local.fileName.indexOf("Current") != -1) {
	// Handle the correct utility bill
	// Prepare the document for upload
	tw.local.ecmProperties = new tw.object.listOf.ECMProperty();
	tw.local.ecmProperties[0] = new tw.object.ECMProperty();
	tw.local.ecmProperties[0].objectTypeId = "CO_ServiceAddress";
	tw.local.ecmProperties[0].value = "172 S Topanga Canyon Blvd, CA, Topanga 90290";
	tw.local.ecmProperties[1] = new tw.object.ECMProperty();
	tw.local.ecmProperties[1].objectTypeId = "CO_ClientName";
	tw.local.ecmProperties[1].value = tw.local.caseProperties.ClientName.value;
	tw.local.ecmProperties[2] = new tw.object.ECMProperty();
	tw.local.ecmProperties[2].objectTypeId = "CO_ReferenceID";
	tw.local.ecmProperties[2].value = tw.local.caseProperties.ReferenceID.value;

	tw.local.documentClassFilenet = "CO_UtilityBill";
	tw.local.fileName = "Utility Bill - " + tw.local.caseProperties.ClientName.value;

	tw.system.currentProcessInstance.parentCase.addCommentToCase("A utility bill was provided by the client and has been verified automatically.");
	tw.local.isValidDocument = true;
	tw.local.documentClassADP = "Utility Bill";
} else if(tw.local.fileName.indexOf("Old") != -1) {
	// Handle the incorrect utility bill
	// Prepare the email body requesting the utility bill to be submitted again
	var addressInSubmission = tw.local.caseProperties.AddressStreet.value + ", " + tw.local.caseProperties.AddressState.value + ", " + tw.local.caseProperties.AddressCity.value + " " + tw.local.caseProperties.AddressZipCode.value;
	var addressInDocument = "2381 Augusta Park Marlinton, WV 24954";
	tw.local.emailContent = tw.local.emailContent = "Hello " + tw.local.caseProperties.FirstName.value + ",<br/><br/>This is with reference to your request with reference ID: " + tw.local.caseProperties.ReferenceID.value + "<br/><br/>The address provided in the utility bill you provided does not match the address in your request.<br/><br/>The address in your request is: " + addressInSubmission + "<br/>The address in the utility bill is: " + addressInDocument + "<br/><br/>Please re-upload a utility bill with the right address <a href=\"" + tw.env.documentUploadPage + "?ReferenceID=" + tw.local.caseProperties.ReferenceID.value + "\">on the following page</a>.<br/><br/>Regards,<br/>Focus Corp";

	// Add a comment to the case
	tw.system.currentProcessInstance.parentCase.addCommentToCase("The address in the utility bill provided does not match the address in the request. Waiting for the client to send another utility bill.");
	tw.local.isValidDocument = false;
	tw.local.documentClassADP = "Utility Bill";
} else {
	// Document other than the provided bills
	tw.local.documentClassADP = "Other";
}

var pendingDocuments = [];
var reviewedDocuments = tw.local.caseProperties.ReviewedDocuments.value;

for(var i=0; i<reviewedDocuments.listLength; i++) {
	if(reviewedDocuments[i].DocumentStatus.value == "Pending") {
		pendingDocuments[pendingDocuments.length] = reviewedDocuments[i].DocumentName.value;
	}
}

tw.local.pendingDocuments = pendingDocuments;
tw.local.emailContent = "Hello " + tw.local.caseProperties.FirstName.value + ",<br/><br/>This is with reference to your request with reference ID: " + tw.local.caseProperties.ReferenceID.value + "<br/><br/>We need additional documents to process your request:<br/>" + tw.local.pendingDocuments.listToNativeArray().toString().replace(/,/g, "<br/>") + "<br/><br/>Please <a href=\"" + tw.env.documentUploadPage + "?ReferenceID=" + tw.local.caseProperties.ReferenceID.value + "\">upload the documents on the following page</a>.<br/><br/>Regards,<br/>Focus Corp";

var selectedDocumentIDs = tw.local.caseProperties.SelectedDocumentIDs.value;
if(!!selectedDocumentIDs && selectedDocumentIDs.listLength > 0) {
	for(var i=0; i < selectedDocumentIDs.listLength; i++) {
		tw.system.currentProcessInstance.parentCase.fileDocumentInCase(selectedDocumentIDs[i], "/", true);
	}
}
